import React from 'react';
import web from "./img.jpg";
import { NavLink } from "react-router-dom";
import Common from './Common';
const Home = () =>{
    return (
        <>
            <Common name=' Grow your business with' imgsrc={web} visit='/Service' btname='Get Started'/>
        </>
    );
};
export default Home;
